gvU(){return"Danach, wenn Sie gen\xfcgend Token haben, um zu spielen, k\xf6nnen Sie Ihre neue Kampagne starten!\n\n"},
gvV(){return"Dieser Teil ist wichtig. Da eine KI f\xfcr die Anleitung des Spiels verantwortlich ist und nicht ein Mensch, m\xfcssen sich alle Spieler verpflichten, bestimmte Richtlinien zu befolgen, um den Spielfluss zu erleichtern:\n\n"},
gvW(){return"Halten Sie sich an Ihr Charakterblatt: Erinnern Sie sich an die Details Ihres Charakters und integrieren Sie sie bei jeder Gelegenheit in das Gespr\xe4ch, um der KI mehr Kontext zu bieten. \xc4ndern Sie die Details Ihres Charakters nicht, es sei denn, Sie werden dazu aufgefordert.\n\n"},
gvX(){return"Erfinden Sie keine W\xfcrfelergebnisse: Der nat\xfcrliche Mechanismus f\xfcr Rollenspiele sind W\xfcrfelw\xfcrfe. Wenn Sie aufgefordert werden, einen Wurf zu machen, erfinden Sie keine Werte. Akzeptieren Sie die Zuf\xe4lligkeit!\n\n"},
gvY(){return"Halten Sie die KI im Kontext: Wir vertrauen darauf, dass Sie der Geschichte folgen, die von der KI bereitgestellt wird. Korrigieren Sie, wenn n\xf6tig, treffen Sie Entscheidungen, die Ihr Charakter treffen w\xfcrde, und schlagen Sie Ihren eigenen Weg ein, aber weichen Sie nicht in nicht zusammenh\xe4ngende Themen ab. Sie k\xf6nnten die KI verwirren und die Erz\xe4hlung st\xf6ren.\n\n"},
gvO(){return"Kein Schummeln: Wir appellieren an die Wohlgesonnenheit unserer Spieler. Wenn etwas schief geht, z\xf6gern Sie nicht, der KI zu helfen, sich an bestimmte Entscheidungen und Aspekte Ihres Charakterblatts zu erinnern.\n\n"},
gvP(){return"Verhalten Sie sich so, wie Sie es mit Ihrem vertrauensw\xfcrdigen Spielleiter tun w\xfcrden: Es ist die Verantwortung jedes Spielers, sicherzustellen, dass es ein unterhaltsames und leicht verst\xe4ndliches Spiel ist.\n\n"},
gvQ(){return"Haftungsausschluss: Da es sich um eine externe Konversations-KI handelt, sind wir nicht verantwortlich f\xfcr den Inhalt der Gespr\xe4che. Wir vertrauen auf Sie!"},
