grf(){return"Dungeons & Dragons: Eine Reise in die Vorstellungskraft"},
grq(){return"Willkommen bei Dungeons & Dragons (D&D), einem Spiel, das die Grenzen des Tabletop-Spielens \xfcberwindet und zu einem immersiven Abenteuer in die Bereiche Kreativit\xe4t, Strategie und Geschichtenerz\xe4hlen wird. Im Kern ist D&D mehr als nur ein Spiel; es ist eine geteilte Erfahrung, bei der die Spieler zu den Helden ihrer eigenen epischen Geschichten werden.\n\n"},
grD(){return"Die Essenz von D&D: Ein gemeinsames Abenteuer"},
grL(){return"D&D ist nicht nur ein Spiel; es ist eine gemeinschaftliche Geschichtenerz\xe4hlung, bei der die Spieler die Rollen einzigartiger Charaktere in einer Fantasy-Welt \xfcbernehmen. Gef\xfchrt von einem Dungeon Master (DM) entfaltet sich die Handlung durch eine Reihe von Quests, Herausforderungen und unerwarteten Wendungen. Die Essenz liegt in der Freiheit, die Geschichte gemeinsam zu gestalten und Erinnerungen zu schaffen, die lange nach dem W\xfcrfeln haften bleiben.\n\n"},
grM(){return"Wie man spielt: Eine Symphonie aus W\xfcrfeln und Entscheidungen"},
grN(){return"Erschaffe deinen heldenhaften Charakter"},
grO(){return"W\xe4hle Rasse, Klasse und Hintergrund f\xfcr deinen Charakter. Wirst du ein elfischer Zauberer mit geheimnisvoller Vergangenheit oder ein zwergischer Krieger, der geschworen hat, seine Verb\xfcndeten zu verteidigen?\n\n"},
grP(){return"Bestimme die F\xe4higkeiten, St\xe4rken und Schw\xe4chen deines Charakters durch den Wurf der W\xfcrfel.\n\n"},
grQ(){return"Begib dich auf Abenteuer"},
grg(){return"Kooperiere mit deinen Mitabenteurern und starte Quests, die vom Dungeon Master pr\xe4sentiert werden.\n\n"},
grh(){return"Navigiere durch Verliese, stelle dich mythischen Kreaturen und entdecke die Geheimnisse der Fantasy-Welt.\n\n"},
gri(){return"Rollenspiel"},
grj(){return"Tauche in die Pers\xf6nlichkeit deines Charakters ein. Sprich, denke und handle so, wie es dein Held in der gegebenen Situation tun w\xfcrde.\n\n"},
grk(){return"Beteilige dich an Interaktionen mit Nicht-Spieler-Charakteren, triff Entscheidungen, die den Verlauf der Handlung beeinflussen.\n\n"},
grl(){return"W\xfcrfle die W\xfcrfel"},
grm(){return"Das Spiel basiert auf einem Satz von Polyeder-W\xfcrfeln, um die Ergebnisse von Aktionen zu bestimmen. Der ikonische 20-seitige W\xfcrfel (d20) entscheidet oft \xfcber Erfolg oder Misserfolg deiner Bem\xfchungen.\n\n"},
grn(){return"Kritische Treffer, Rettungsw\xfcrfe und F\xe4higkeitspr\xfcfungen f\xfcgen dem Spiel eine Element der Chance hinzu.\n\n"},
gro(){return"Die Kunst des Dungeon Masters"},
grp(){return"Der Dungeon Master fungiert als Geschichtenerz\xe4hler, Erz\xe4hler und Schiedsrichter. Sie f\xfchren die Spieler durch die Welt, pr\xe4sentieren Herausforderungen und reagieren auf Spielerentscheidungen.\n\n"},
grr(){return"Ein erfolgreicher DM webt eine dynamische Erz\xe4hlung, passt sich an Spielerentscheidungen und Unvorhersehbarkeiten an.\n\n"},
grs(){return"Erschaffen deines Charakters: Entfessle deinen inneren Helden"},
grt(){return"Rasse"},
gru(){return"W\xe4hle eine Rasse f\xfcr deinen Charakter, jede mit einzigartigen F\xe4higkeiten und Merkmalen. Die Optionen reichen von Menschen und Elfen bis zu Zwergen, Halblingen und mehr.\n\n"},
grv(){return"Klasse"},
grw(){return"W\xe4hle eine Klasse, die die Berufsrichtung und F\xe4higkeiten deines Charakters definiert. Wirst du ein m\xe4chtiger Zauberer, ein listiger Schurke oder ein widerstandsf\xe4higer Kleriker sein?\n\n"},
grz(){return"Hintergrund"},
grA(){return"Bestimme den Hintergrund deines Charakters, der ihre F\xe4higkeiten, Pers\xf6nlichkeitsmerkmale und Verbindungen zur Welt pr\xe4gt. Hintergr\xfcnde umfassen Adepten, Gesetzlose, Gelehrte und mehr.\n\n"},
grB(){return"F\xe4higkeitspunkte"},
grC(){return"Generiere oder weise F\xe4higkeitspunkte (St\xe4rke, Geschicklichkeit, Konstitution, Intelligenz, Weisheit, Charisma) zu, die die F\xe4higkeiten deines Charakters beeinflussen.\n\n"},
grE(){return"Ausr\xfcstung"},
grF(){return"R\xfcste deinen Charakter mit Startausr\xfcstung basierend auf ihrer Klasse und ihrem Hintergrund aus. Zus\xe4tzliche Ausr\xfcstung kann durch In-Game-Erkundung und Quests erhalten werden.\n\n"},
grG(){return"Vorgeschichte"},
grH(){return"Entwickle eine reiche Vorgeschichte f\xfcr deinen Charakter. Erforsche ihre Urspr\xfcnge, Motivationen und pers\xf6nlichen Ziele, um eine narrative Grundlage f\xfcr das Rollenspiel zu schaffen.\n\n"},
grI(){return"Ausrichtung"},
grJ(){return"W\xe4hle eine Ausrichtung, die den moralischen und ethischen Kompass deines Charakters widerspiegelt. Ausrichtungen reichen von rechtschaffen gut bis chaotisch b\xf6se.\n\n"},
grK(){return"D&D ist eine offene Leinwand, auf der die einzige Grenze deine Vorstellungskraft ist. Also, versammle deine Freunde, mache deine W\xfcrfel bereit und st\xfcrze dich in eine Reise, bei der jede Entscheidung, jeder Wurf und jeder geteilte Moment zu einem Teil deines einzigartigen Abenteuers in den Reichen von Dungeons & Dragons wird. M\xf6gen deine Quests k\xfchn sein, deine W\xfcrfe gl\xfccklich und deine Geschichten legend\xe4r!\n\n"},
