gvN(){return"\xa1Bienvenido/a a la secci\xf3n de Reglas! Aqu\xed, aprender\xe1s r\xe1pidamente lo que necesitas para comenzar y divertirte.\n\n"},
gvR(){return"C\xf3mo jugar"},
gvS(){return"Para empezar a jugar, simplemente presiona el bot\xf3n 'Iniciar juego' y selecciona el modo de juego (en esta primera versi\xf3n, solo est\xe1 disponible el modo de un solo jugador). A continuaci\xf3n, puedes elegir el rol que quieres interpretar:\n\n"},
gvT(){return"Una vez que hayas seleccionado tu modo de juego, puedes configurar tu partida. Necesitar\xe1s proporcionar una breve descripci\xf3n del entorno de la historia que deseas seguir (incluyendo la condici\xf3n para finalizar el juego) y crear la hoja de personaje. No te preocupes si no tienes experiencia en esto; el juego puede generar una hoja de personaje por ti, \xa1lo hace todo! (Actualmente, el juego solo proporciona hojas de personajes generadas autom\xe1ticamente).\n\n"},
gvU(){return"Despu\xe9s de esto, si tienes suficientes fichas para jugar, \xa1puedes comenzar tu nueva campa\xf1a!\n\n"},
gvV(){return"Esta parte es importante. Dado que es una IA la encargada de guiar el juego, y no un humano, todos los jugadores deben comprometerse a seguir ciertas pautas para facilitar el flujo del juego:\n\n"},
gvW(){return"Apegarse a la hoja de personaje: Recuerda los detalles de tu personaje e incorp\xf3ralos a la conversaci\xf3n siempre que sea posible para proporcionar m\xe1s contexto a la IA. No cambies los detalles de tu personaje a menos que se te indique hacerlo.\n\n"},
gvX(){return"No inventar tiradas de dados: El mecanismo natural para el juego de rol son las tiradas de dados. Si se te pide que hagas una tirada, no inventes los valores. \xa1Acepta la aleatoriedad!\n\n"},
gvY(){return"Mant\xe9n la IA en contexto: Confiamos en que seguir\xe1s la historia proporcionada por la IA. Despu\xe9s de todo, no es humana. Corrige cuando sea necesario, toma decisiones que tu personaje tomar\xeda y forja tu propio camino, pero no te desv\xedes hacia temas no relacionados. Podr\xedas confundir a la IA y perturbar la narrativa.\n\n"},
gvO(){return"Sin hacer trampas: Apelamos a la buena voluntad de nuestros jugadores. Si las cosas van mal, no dudes en ayudar a la IA a recordar ciertas decisiones y aspectos de tu hoja de personaje.\n\n"},
gvP(){return"Comportarse como lo har\xedas con tu querido Director de Juego: Es responsabilidad de cada jugador asegurarse de que sea un juego agradable y f\xe1cil de seguir.\n\n"},
gvQ(){return"Descargo de responsabilidad: Dado que es una IA conversacional externa, no somos responsables del contenido de las conversaciones. \xa1Confiamos en ti!"},
