gqB(){return"Llamada de Cthulhu: Un Descenso al Horror C\xf3smico"},
gqM(){return"Bienvenido a Llamada de Cthulhu, un juego de rol que te sumerge en los inquietantes reinos del horror c\xf3smico inspirado en las obras de H.P. Lovecraft. Este juego no se trata solo de sobrevivir; se trata de mantener la cordura mientras te enfrentas a entidades antiguas y mal\xe9volas que desaf\xedan la comprensi\xf3n humana. Prep\xe1rate para embarcarte en un viaje donde los misterios son oscuros y los horrores van m\xe1s all\xe1 de la comprensi\xf3n.\n\n"},
gqX(){return"La Esencia de Llamada de Cthulhu: Abrazar lo Desconocido"},
gr5(){return"Llamada de Cthulhu prepara el escenario para una narrativa empapada de misterio, temor y lo desconocido. Como investigadores, los jugadores desentra\xf1an conspiraciones, enfrentan horrores arcanos y luchan con la fragilidad de su propia cordura. Es un juego donde la supervivencia puede significar escapar con la mente intacta en lugar de salir ileso.\n\n"},
gr6(){return"C\xf3mo Jugar: Una Danza con la Locura"},
gr7(){return"Crea tu Investigador"},
