gmn(){return"\xc0 Propos"},
gtJ(){return"Au c\u0153ur de notre d\xe9marche, nous sommes un groupe d\xe9vou\xe9 de passionn\xe9s de jeu de r\xf4le partageant un objectif commun : rendre le monde enchanteur des jeux de r\xf4le accessible \xe0 tous. Nous croyons que la magie de la narration et des aventures immersives devrait \xeatre \xe0 la port\xe9e de tous ceux qui aspirent \xe0 la fr\xe9n\xe9sie de cr\xe9er et de se lancer dans des qu\xeates \xe9piques. Que vous soyez un v\xe9t\xe9ran chevronn\xe9 ou un novice complet, notre mission est de fournir les outils, les conseils et les ressources pour vous plonger dans le monde captivant des jeux de r\xf4le. Nous sommes l\xe0 pour encourager la cr\xe9ativit\xe9, stimuler l'imagination et construire une communaut\xe9 accueillante o\xf9 les merveilles du jeu de r\xf4le sont c\xe9l\xe9br\xe9es."},
gtK(){return"Notre parcours est aliment\xe9 par un amour profond pour la narration, un engagement envers l'inclusivit\xe9 et le d\xe9sir de connecter avec des individus partageant notre passion. Avec une richesse d'exp\xe9rience et un enthousiasme d\xe9bordant, nous nous effor\xe7ons de briser les barri\xe8res, de simplifier la courbe d'apprentissage et de vous autonomiser pour vous lancer dans vos propres aventures uniques. Que vous soyez ma\xeetre de donjon, joueur, ou simplement curieux de ce monde captivant, rejoignez-nous dans cette qu\xeate \xe9pique alors que nous nous effor\xe7ons de faire des jeux de r\xf4le une exp\xe9rience d\xe9licieuse et accessible pour tous."},
