gpQ(){return"Le jeu de r\xf4le Aliens se d\xe9roule g\xe9n\xe9ralement dans un univers futuriste et spatial o\xf9 l'humanit\xe9 et diverses esp\xe8ces extraterrestres coexistent. Les joueurs peuvent choisir parmi une vari\xe9t\xe9 de r\xf4les de personnages, des explorateurs spatiaux aux diplomates ou mercenaires extraterrestres.\n\n"},
gq0(){return"Le jeu utilise souvent un syst\xe8me de r\xe8gles combinant narration, d\xe9veloppement de personnage et m\xe9canique de d\xe9s. Les joueurs cr\xe9ent des personnages avec des attributs et des comp\xe9tences uniques, et ils interagissent avec le monde du jeu \xe0 travers des interactions narratives et des lancers de d\xe9s.\n\n"},
gqb(){return"Les joueurs cr\xe9ent g\xe9n\xe9ralement des personnages en choisissant une esp\xe8ce (humaine ou extraterrestre) et en attribuant des attributs, des comp\xe9tences et des ant\xe9c\xe9dents. Ces choix d\xe9finissent les capacit\xe9s du personnage et son r\xf4le dans le monde du jeu.\n\n"},
