gpS(){return"Les agendas personnels ajoutent de la profondeur au d\xe9veloppement des personnages et au jeu de r\xf4le. Chaque personnage peut avoir ses propres objectifs personnels, d\xe9sirs et motivations qui peuvent entrer en conflit ou s'aligner avec l'histoire globale.\n\n"},
gpT(){return"Encouragez les joueurs \xe0 cr\xe9er des agendas personnels pour leurs personnages qui s'alignent avec les th\xe8mes et le r\xe9cit du jeu.\n\n"},
gpU(){return"Vous pouvez recevoir des r\xe9compenses, des accroches narratives ou des opportunit\xe9s de d\xe9veloppement de personnage li\xe9es \xe0 la r\xe9alisation des agendas personnels.\n\n"},
gpV(){return"Utilisez les agendas personnels pour introduire des dilemmes de personnage, des choix moraux et des conflits qui enrichissent l'exp\xe9rience narrative.\n\n"},
gpW(){return"Dans le jeu de r\xf4le Aliens, la m\xe9canique des d\xe9s offre une fa\xe7on d'introduire l'incertitude et le hasard dans le jeu, permettant aux joueurs de d\xe9terminer les r\xe9sultats des actions des personnages, des combats et des divers d\xe9fis.\n\n"},
gpX(){return"D\xe9cidez des types de d\xe9s \xe0 utiliser dans le jeu. Par exemple, vous pouvez utiliser un d\xe9 standard \xe0 six faces (D6) pour des v\xe9rifications de comp\xe9tences simples, un d\xe9 \xe0 dix faces (D10) pour des actions plus complexes, et un d\xe9 \xe0 vingt faces (D20) pour des \xe9v\xe9nements critiques ou importants.\n\n"},
gpY(){return"Associez les capacit\xe9s, comp\xe9tences et attributs du personnage \xe0 des lancers de d\xe9s sp\xe9cifiques. Par exemple, un personnage avec des comp\xe9tences \xe9lev\xe9es en n\xe9gociation pourrait lancer un D10 et ajouter son attribut de charisme pour d\xe9terminer le r\xe9sultat d'une rencontre diplomatique.\n\n"},
gpZ(){return"D\xe9finissez des seuils de r\xe9ussite pour les lancers de d\xe9s. Les joueurs doivent g\xe9n\xe9ralement atteindre ou d\xe9passer un num\xe9ro cible (un 'seuil de r\xe9ussite') pour r\xe9ussir leurs actions. Le seuil peut varier en fonction de la difficult\xe9 de la t\xe2che.\n\n"},
gq_(){return"Envisagez d'incorporer des modificateurs qui peuvent influencer les lancers de d\xe9s. Ces modificateurs peuvent provenir des comp\xe9tences du personnage, de l'\xe9quipement, de facteurs environnementaux ou d'autres circonstances de jeu.\n\n"},
gq1(){return"Incluez des m\xe9canismes de r\xe9ussite critique et d'\xe9chec critique. Par exemple, obtenir le nombre le plus \xe9lev\xe9 possible sur le d\xe9 pourrait entra\xeener un succ\xe8s extraordinaire, tandis que le plus bas pourrait conduire \xe0 un \xe9chec catastrophique.\n\n"},
gq2(){return"Mettez en place le concept de pools de d\xe9s, o\xf9 les personnages accumulent et lancent plusieurs d\xe9s en fonction de leurs capacit\xe9s ou avantages. La somme des d\xe9s dans le pool d\xe9termine le r\xe9sultat.\n\n"},
gq3(){return"Un Ma\xeetre de Jeu (MJ) guide l'histoire et agit comme le conteur, contr\xf4lant les personnages non-joueurs (PNJ), les environnements et les d\xe9fis auxquels les personnages des joueurs sont confront\xe9s. Le MJ aide \xe0 fa\xe7onner le r\xe9cit et \xe0 s'adapter aux choix des joueurs.\n\n"},
gq4(){return"Les joueurs rencontrent fr\xe9quemment une grande vari\xe9t\xe9 d'esp\xe8ces extraterrestres, chacune ayant des caract\xe9ristiques, des capacit\xe9s et des cultures uniques. La diplomatie, la n\xe9gociation et le combat peuvent tous entrer en jeu lorsqu'il s'agit de traiter avec ces \xeatres extraterrestres.\n\n"},
gq5(){return"Le jeu encourage l'exploration de mondes extraterrestres divers, de stations spatiales et de ph\xe9nom\xe8nes cosmiques. Cette exploration conduit souvent \xe0 la d\xe9couverte de secrets, de d\xe9fis et de nouveaux alli\xe9s.\n\n"},
gq6(){return"Le combat peut \xeatre une partie int\xe9grante du jeu, les personnages faisant face \xe0 des menaces extraterrestres, des pirates ou m\xeame d'autres factions dans l'univers du jeu. Utilisez votre \xe9quipement pour vaincre vos ennemis... et essayez de ne pas paniquer trop souvent, sinon vous perdrez votre sant\xe9 mentale. Le syst\xe8me devrait cr\xe9er de la tension, simuler une action rapide et permettre une prise de d\xe9cision strat\xe9gique.\n\n"},
gq7(){return"D\xe9terminez l'ordre des actions en combat en utilisant un syst\xe8me d'initiative. Cela peut \xeatre bas\xe9 sur la vitesse, les comp\xe9tences des personnages ou un simple lancer de d\xe9s.\n\n"},
