gqd(){return"Int\xe9grez des m\xe9canismes de coups critiques o\xf9 un r\xe9sultat sp\xe9cifique (par exemple, obtenir un 20 naturel) conduit \xe0 un coup critique, infligeant des d\xe9g\xe2ts suppl\xe9mentaires. Permettez des capacit\xe9s sp\xe9ciales propres aux personnages qui peuvent \xeatre utilis\xe9es en combat pour des effets uniques.\n\n"},
