grN(){return"Crea il Tuo Personaggio Eroico"},
grO(){return"Scegli razza, classe e background per il tuo personaggio. Sarai un mago elfico dal passato misterioso o un guerriero nano giurato a difendere i tuoi alleati?\n\n"},
grP(){return"Determina le abilit\xe0, i punti di forza e le debolezze del tuo personaggio attraverso il tiro dei dadi.\n\n"},
