gqB(){return"Chiamata di Cthulhu: Una Discesa nell'Orrore Cosmico"},
gqM(){return"Benvenuto in Chiamata di Cthulhu, un gioco di ruolo che ti immerger\xe0 nei perturbanti regni dell'orrore cosmico ispirato alle opere di H.P. Lovecraft. Questo gioco non riguarda solo la sopravvivenza; si tratta di mantenere la sanit\xe0 mentale mentre affronti antiche e malevole entit\xe0 che sfidano la comprensione umana. Preparati per intraprendere un viaggio dove i misteri sono oscuri e gli orrori vanno oltre la comprensione.\n\n"},
gqX(){return"L'Essenza di Chiamata di Cthulhu: Abbraccia l'Ignoto"},
gr5(){return"Chiamata di Cthulhu prepara il terreno per una narrazione intrisa di mistero, terrore e sconosciuto. Come investigatori, i giocatori sveleranno cospirazioni, affronteranno orrori cosmici e si scontreranno con la fragilit\xe0 della propria sanit\xe0 mentale. \xc8 un gioco in cui sopravvivere potrebbe significare scappare con la propria mente intatta piuttosto che emergere incolumi.\n\n"},
