grN(){return"\u0421\u043e\u0437\u0434\u0430\u0439\u0442\u0435 \u0441\u0432\u043e\u0435\u0433\u043e \u0413\u0435\u0440\u043e\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u041f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430"},
grO(){return"\u0412\u044b\u0431\u0435\u0440\u0438\u0442\u0435 \u0440\u0430\u0441\u0443, \u043a\u043b\u0430\u0441\u0441 \u0438 \u043f\u0440\u043e\u0448\u043b\u043e\u0435 \u0434\u043b\u044f \u0441\u0432\u043e\u0435\u0433\u043e \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430. \u0421\u0442\u0430\u043d\u0435\u0442\u0435 \u043b\u0438 \u0432\u044b \u044d\u043b\u044c\u0444\u0438\u0439\u0441\u043a\u0438\u043c \u0432\u043e\u043b\u0448\u0435\u0431\u043d\u0438\u043a\u043e\u043c \u0441 \u0442\u0430\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u043f\u0440\u043e\u0448\u043b\u044b\u043c \u0438\u043b\u0438 \u0433\u043d\u043e\u043c\u044c\u0438\u043c \u0432\u043e\u0438\u043d\u043e\u043c, \u043a\u043b\u044f\u043d\u0443\u0449\u0438\u043c\u0441\u044f \u0437\u0430\u0449\u0438\u0449\u0430\u0442\u044c \u0441\u043e\u044e\u0437\u043d\u0438\u043a\u043e\u0432?\n\n"},
grP(){return"\u041e\u043f\u0440\u0435\u0434\u0435\u043b\u0438\u0442\u0435 \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u043e\u0441\u0442\u0438, \u0441\u0438\u043b\u044c\u043d\u044b\u0435 \u0438 \u0441\u043b\u0430\u0431\u044b\u0435 \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0432\u0430\u0448\u0435\u0433\u043e \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430 \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u0431\u0440\u043e\u0441\u043a\u0430 \u043a\u043e\u0441\u0442\u0435\u0439.\n\n"},
