gri(){return"\u0420\u043e\u043b\u0435\u0432\u0430\u044f \u0418\u0433\u0440\u0430"},
grj(){return"\u041f\u043e\u0433\u0440\u0443\u0437\u0438\u0442\u0435\u0441\u044c \u0432 \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u044c \u0441\u0432\u043e\u0435\u0433\u043e \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430. \u0413\u043e\u0432\u043e\u0440\u0438\u0442\u0435, \u0434\u0443\u043c\u0430\u0439\u0442\u0435 \u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u0439\u0442\u0435 \u0442\u0430\u043a, \u043a\u0430\u043a \u0432\u0430\u0448 \u0433\u0435\u0440\u043e\u0439 \u043f\u043e\u0441\u0442\u0443\u043f\u0438\u043b \u0431\u044b \u0432 \u0434\u0430\u043d\u043d\u043e\u0439 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438.\n\n"},
grk(){return"\u0412\u0437\u0430\u0438\u043c\u043e\u0434\u0435\u0439\u0441\u0442\u0432\u0443\u0439\u0442\u0435 \u0441 \u043d\u0435\u0438\u0433\u0440\u043e\u0432\u044b\u043c\u0438 \u043f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430\u043c\u0438, \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0439\u0442\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u044f, \u0432\u043b\u0438\u044f\u044e\u0449\u0438\u0435 \u043d\u0430 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u0441\u044e\u0436\u0435\u0442\u0430.\n\n"},
grl(){return"\u0411\u0440\u043e\u0441\u044c\u0442\u0435 \u041a\u043e\u0441\u0442\u0438"},
grm(){return"\u0418\u0433\u0440\u0430 \u0437\u0430\u0432\u0438\u0441\u0438\u0442 \u043e\u0442 \u043d\u0430\u0431\u043e\u0440\u0430 \u043c\u043d\u043e\u0433\u043e\u0433\u0440\u0430\u043d\u043d\u044b\u0445 \u043a\u043e\u0441\u0442\u0435\u0439 \u0434\u043b\u044f \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u0432 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439. \u0418\u043a\u043e\u043d\u0438\u0447\u043d\u044b\u0439 20-\u0433\u0440\u0430\u043d\u043d\u044b\u0439 \u043a\u0443\u0431 (d20) \u0447\u0430\u0441\u0442\u043e \u0440\u0435\u0448\u0430\u0435\u0442 \u0443\u0441\u043f\u0435\u0445 \u0438\u043b\u0438 \u043d\u0435\u0443\u0434\u0430\u0447\u0443 \u0432\u0430\u0448\u0438\u0445 \u0443\u0441\u0438\u043b\u0438\u0439.\n\n"},
grn(){return"\u041a\u0440\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0435 \u0443\u0434\u0430\u0440\u044b, \u0441\u043f\u0430\u0441\u0431\u0440\u043e\u0441\u043a\u0438 \u0438 \u043f\u0440\u043e\u0432\u0435\u0440\u043a\u0438 \u043d\u0430\u0432\u044b\u043a\u043e\u0432 \u0434\u043e\u0431\u0430\u0432\u043b\u044f\u044e\u0442 \u044d\u043b\u0435\u043c\u0435\u043d\u0442 \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u043e\u0441\u0442\u0438 \u0432 \u0438\u0433\u0440\u0443.\n\n"},
gro(){return"\u0418\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u043e \u041c\u0430\u0441\u0442\u0435\u0440\u0430 \u041f\u043e\u0434\u0437\u0435\u043c\u0435\u043b\u0438\u0439"},
grp(){return"\u041c\u0430\u0441\u0442\u0435\u0440 \u041f\u043e\u0434\u0437\u0435\u043c\u0435\u043b\u0438\u0439 \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0432 \u0440\u043e\u043b\u0438 \u0440\u0430\u0441\u0441\u043a\u0430\u0437\u0447\u0438\u043a\u0430, \u043f\u043e\u0432\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u0435\u043b\u044f \u0438 \u0441\u0443\u0434\u044c\u0438. \u041e\u043d \u0432\u0435\u0434\u0435\u0442 \u0438\u0433\u0440\u043e\u043a\u043e\u0432 \u043f\u043e \u043c\u0438\u0440\u0443, \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u044f\u044f \u0432\u044b\u0437\u043e\u0432\u044b \u0438 \u0440\u0435\u0430\u0433\u0438\u0440\u0443\u044f \u043d\u0430 \u0432\u044b\u0431\u043e\u0440\u044b \u0438\u0433\u0440\u043e\u043a\u043e\u0432.\n\n"},
grr(){return"\u0423\u0441\u043f\u0435\u0448\u043d\u044b\u0439 \u041c\u0430\u0441\u0442\u0435\u0440 \u041f\u043e\u0434\u0437\u0435\u043c\u0435\u043b\u0438\u0439 \u0442\u043a\u0430\u0435\u0442 \u0434\u0438\u043d\u0430\u043c\u0438\u0447\u043d\u0443\u044e \u043f\u043e\u0432\u0435\u0441\u0442\u044c, \u0430\u0434\u0430\u043f\u0442\u0438\u0440\u0443\u044f\u0441\u044c \u043a \u0440\u0435\u0448\u0435\u043d\u0438\u044f\u043c \u0438\u0433\u0440\u043e\u043a\u043e\u0432 \u0438 \u043d\u0435\u043f\u0440\u0435\u0434\u0441\u043a\u0430\u0437\u0443\u0435\u043c\u043e\u0441\u0442\u0438.\n\n"},
grs(){return"\u0421\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0412\u0430\u0448\u0435\u0433\u043e \u041f\u0435\u0440\u0441\u043e\u043d\u0430\u0436\u0430: \u041e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u0412\u0430\u0448\u0435\u0433\u043e \u0412\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0435\u0433\u043e \u0413\u0435\u0440\u043e\u044f"},
